import './header.css';
import './footer.css';

export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Welcome />
      <HomepageCarousel />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <header className="md:flex md:flex-row">
      <div>
        <img src="images/logo.png" alt="Logo PetMeeting" width={400} />
      </div>
      <nav className="container md:flex md:flex-row mx-auto my-auto md:h-12">
        <ul className="flex-col p-6 max-w-max mx-auto text-white m-0 md:flex md:flex-row md:pt-0">
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover: ani">ANNONCES</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover: ani">PUBLIER</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover: ani">MEMBRES</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover: ani">CONTACT</li>
        </ul>
      </nav>
    </header>
  );
}

function Welcome() {
  return (
    <div>Welcome!</div>
  );
}

function HomepageCarousel() {
  return (
    <div>Carousel</div>
  );
}

function Footer() {
  return (
    <footer>Tous droits réservés PetMeeting 2024</footer>
  );
}
